import "./index.css";
import { Link } from "react-router-dom";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import Necas from "./Necas";

const App = () => {
  const onClick = () => {
    console.log("Click");
  };

  return (
    <Router>
      <Routes>
        <Route
          path="/"
          element={
            <div className="container">
              <Link>
                {" "}
                <button className="Button" onClick={onClick}>
                  Click
                </button>
              </Link>
            </div>
          }
        />
        <Route path="/necas" element={<Necas />} />
      </Routes>
    </Router>
  );
};

export default App;
